import React, { Component } from 'react'
import styled from 'styled-components'

export default class ButtonX extends Component {
	render() {
		return (
			<ButtonContainer>
				{this.props.children}
			</ButtonContainer>
		)
	}
}
const ButtonContainer = styled.button`
		text-transform:capitalize;
		font-size:1.4rem;
		color:red;
	`
